import { combineReducers } from 'redux';
import questionsDataReducer from './questionsDataReducer';
import gravatarReducer from './gravatarReducer';
import apiTokenReducer from './apiTokenReducer';

const rootReducer = combineReducers({ questionsDataReducer, gravatarReducer, apiTokenReducer });

export default rootReducer;
